import React from 'react';
import { AppBar, Toolbar, Typography, Button } from '@mui/material';

const Header = () => {
  return (
    <AppBar position="static" sx={{ backgroundColor: 'white', borderBottom: '20px solid black', borderLeft: '750px solid black', borderRight: '390px solid black', borderTop: '20px solid black', position: 'relative', height: '100px' }}>


        <Typography variant="h6" component="div" sx={{ color: 'red' }}>
          Your Website
        </Typography>
      
       
      <Toolbar/>
    </AppBar>
  );
};

export default Header;
